import{_ as e,o as t,c as a,O as o}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 3.2-1711 Referenda results; action of Governor.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-1711.md","filePath":"vacode/3.2-1711.md"}'),r={name:"vacode/3.2-1711.md"},n=o('<h1 id="§-3-2-1711-referenda-results-action-of-governor" tabindex="-1">§ 3.2-1711 Referenda results; action of Governor. <a class="header-anchor" href="#§-3-2-1711-referenda-results-action-of-governor" aria-label="Permalink to &quot;§ 3.2-1711 Referenda results; action of Governor.&quot;">​</a></h1><p>If the Governor finds any referenda in order, and that at least a simple majority of those voting are in opposition to the continuation of the equine infectious anemia test assessment, he shall so proclaim and upon such proclamation the assessment shall be discontinued. If the Governor finds that at least a simple majority of those voting are in favor of the continuation of the assessment, the Governor shall not so proclaim.</p><p>2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0497" target="_blank" rel="noreferrer">497</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>, § 3.1-22.66; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',3),i=[n];function s(l,c,f,h,d,_){return t(),a("div",null,i)}const v=e(r,[["render",s]]);export{u as __pageData,v as default};
